import './App.css';
import { Route, Switch } from "react-router";

import Login from './pages/Login';
import Register from './pages/Register';

function App() {
  return (
    <div className="App">
     <Switch>
      <Route exact path="/"><Login /></Route>
      <Route path="/register"><Register /></Route>
    </Switch>
    </div>
  );
}

export default App;
